import React from 'react';
import { Accordion, Card, Button } from 'react-bootstrap';
import './Collapse.css';

export default function Collapse () {
    return (
            <Accordion>
                <Card>
                    <Card.Header>
                        <Accordion.Toggle eventKey="0">
                            <p>Consulta estado de suscripcion</p>
                        </Accordion.Toggle> 
                    </Card.Header>                    
                <Accordion.Collapse eventKey="0">
                    <Card.Body variant="succcess" className="cardBody">
                        <p>Usted se encuentra suscrito.</p>
                    </Card.Body>
                </Accordion.Collapse> 
                </Card>                    
            </Accordion>     
    )
}
